tables.table_schema:
CREATE TABLE WaterSystem (
    system_id INT PRIMARY KEY,
    system_name VARCHAR(50),
    filtration_process VARCHAR(50),
    oxygen_level FLOAT
);

CREATE TABLE WaterCirculationSystems (
    system_id INT PRIMARY KEY,
    system_name VARCHAR(50),
    pump_capacity DECIMAL(10,2),
    water_level DECIMAL(10,2)
);

CREATE TABLE FiltrationProcesses (
    process_id INT PRIMARY KEY,
    process_name VARCHAR(50),
    filter_type VARCHAR(50),
    filter_capacity DECIMAL(10,2)
);

CREATE TABLE OxygenLevels (
    oxygen_id INT PRIMARY KEY,
    measurement_timestamp TIMESTAMP,
    oxygen_level DECIMAL(10,2),
    tank_id INT
);

CREATE TABLE AquacultureTanks (
    tank_id INT PRIMARY KEY,
    tank_name VARCHAR(50),
    tank_size DECIMAL(10,2),
    water_type VARCHAR(50)
);

CREATE TABLE FishStock (
    fish_id INT PRIMARY KEY,
    fish_species VARCHAR(50),
    quantity INT,
    tank_id INT
);
